import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ApiResultGraph({ apiName }) {
  const [apiResults, setApiResults] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:8080/api-result/fetch-apiResult', {
          params: {
            apiName: apiName,
          },
        });
        setApiResults(response.data);
      } catch (error) {
        console.log(error);
      }
    };

    // fetch data when fetchStatusCode is executed
    fetchData();
  }, [apiName]);

  return (
    <div>
      <p>{apiName} の API 結果一覧</p>
      <ul>
        
      </ul>
    </div>
  );
}

export default ApiResultGraph;
